import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";
import Form from "./Form";

export default function HomePage() {
  return (
    <Container>
      <Row>
        <Col>Posts API</Col>
        <Col>
          <Form />
          <Button>View Posts</Button>
        </Col>
      </Row>
    </Container>
  );
}
